import Header from "./components/Header";
import Services from "./components/Services";
import Navbar from "./components/Navbar";
import Pricing from "./components/Pricing";
import { Link } from "react-scroll";
import './css/app.css'

function App() {
  return (
    <div className="App">
      <Navbar />
      <Header />
      <Services />
      <Pricing />
    </div>
  );
}

export default App;
